import React, { Component } from 'react';
import './App.css';
import { Link } from 'react-router-dom';
import axios from 'axios';


function Header(props) {
  return (<h1>{props.message}</h1>)
}

function ErrorMessage(props) {
  return (<h1>{props.message}</h1>)
}

class App extends Component {
  constructor(props) {
    super(props)

    this.state = {
      buslines: []
    }
  }

  componentDidMount() {
    axios.get('http://0.0.0.0:8080/v2/lines/local?latitude=-30.0180494&longitude=-51.1122259')
      .then((response) => {
        this.setState({
          buslines: response.data.content
        })
      })
      .catch((requestError) => {
        if (requestError.response) {
          console.log("resposta inválida")
        } else if (requestError.request) {
          console.log("Erro na request");
        }

      })
  }

  render() {
    var busLines = this.state.buslines
    var messageBody;
    if(busLines.length === 0) {
      messageBody = 'Nenhuma linha foi carregada'
    } else {
      messageBody = busLines
    }

    return (
      <div>
        <Header message={messageBody} />
        <ul>
          <li>
            <Link to={'/home'}>Home</Link>
          </li>
        </ul>
      </div>



    );
  }
}

export default App;
